import React from "react";
import DelIcons from '@material-ui/icons/Delete';
import Button from '@material-ui/core/Button'
const List = ((props)=>{
    return (<>
    <Button onClick= {()=>{
        props.onSelect(props.id)
    }} className="crossbut"><DelIcons/></Button>
    {props.text}
    <br/><br/></>)
})
export default List
